import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  background-color: #2A2634;
  margin-top: 32px;
  height: 112px;
  margin-bottom: 80px;
  border-radius: 8px;
  border-top: 2px solid #9572FC;
border-radius: 8px;
padding: 7px;
box-sizing: border-box;
`;
